import Layout from '../../components/layout/Layout';
import Header from '../../components/header/Header';
import Box from '../../components/box/Box';
import Calendario from '../../components/calendar/Calendar';
import { useDataContext } from '../../services/DataContext';
import "./homePage.css"

const HomePage = () => {

  const { instrutorData } = useDataContext();

  return (
    <Layout>
        <Header title="Página Inicial" description="Bem-vindo!"/>
        <main>
        <div className="home-container">
              <Box title="Horas Produzidas (SIG)" description="0 Horas" type="box"/>
              <Box title="Horas de Serviço Educacional" description="72 Horas" type="box"/>
              <Box title="Total de Horas Cadastradas " description="72 Horas" type="box"/>
              <Box title="Saldo de Horas" description="0 Horas" type="box"/>
        </div>
        <div>
          <Calendario />
        </div>
        </main>
    </Layout>
  );
};

export default HomePage;
